    "2016-11-25T21:06:40.294476",nt"name": "vocational-rehabilitation-programs-performance-monitoring",nt"isopen":
    true,nt"url": null,nt"notes": "View tables with key data and download tables
    on basic Vocational Rehabilitation (VR) programs for each state agency The tables
    (in MS Excel file format) provide information on consumer outcomes, ages, wages
    earned and hours worked during past fiscal years. They also provide financial breakdowns
    of expenditures by vocational rehabilitation agencies as well as information on
    referrals sources, services provided to individuals, counselor caseloads and eligibility
    rates. Tables cover consumer information and information on VR agency expenditures.
    While several programs exist to assist individuals with disabilities to become employed,
    the primary one overseen by the Department of Education is the vocational rehabilitation
    (VR) program. Under Title I of the Rehabilitation Act of 1973, as amended (Act),
    states receive federal grants to operate a comprehensive VR program. These funds
    are awarded to designated state VR agencies within each state. This state-operated
    program is designed to assess, plan, develop and provide VR services to eligible
    individuals with disabilities, consistent with their strengths, resources, priorities,
    concerns, abilities, capabilities, interests and informed choice. By providing services
    in this way, the VR program enables individuals with disabilities to prepare for
    and engage in employment.  For data after 2005, see rsa.ed.gov.",nt"license_title":
